import React, { Component } from 'react'
import Title from '../Components/Title'
const format = {
    paddingLeft: "65px",
    paddingTop: "50px"
}


const product = {
    paddingLeft: "50px",
    paddingTop: "50px"
}

export default class Products extends Component {
    state = {
        products:[]
    }
    render() {
        <React.Fragment>
            <div className="container" style = {format}>
                <div className="row bspace ">
                    <Title name = "our" title ="product"></Title>
                </div>
            </div>

            
        </React.Fragment>
    }
}
